$data = ""
$datasplit = $data.ToCharArray()



for ($i = 3; $i -lt $datasplit.Count; $i++) {
    
    $complete = -join ($data[$i - 3], $data[$i - 2], $data[$i - 1], $data[$i])
    $complete = $complete.ToCharArray()
    $complete = $complete | Select-Object -Unique
    if ($complete.Count -eq 4) { 
        $result = $i +1
        "result {0}" -f $result| write-host
        break
    }

}

